import React, { Component } from 'react';
import './Home.css';

class Home extends Component {
render() {
	return (
	<div className="homePage">
    <h1 className="title">SOUTHWEST HURRICANE AID</h1>
    <h6>Providing aid to those affect by hurricanes in Texas</h6>
	</div>
	);
}
}

export default Home;
